import React from 'react';
import ReactDOM from 'react-dom';
import {ThemeProvider} from 'styled-components';

import './index.scss';
import App from './App.jsx';

const theme = {
    lightreen
}

const Main = () => {
    return (
        <ThemeProvider theme={theme}>
            <App />
        </ThemeProvider>
            )
}

ReactDOM.render(<Main />, document.getElementById('root'));
